import React from "react";
import {Routes,Route} from 'react-router-dom';
import Leaf from './pages/leaf/leaf'
import Home from './pages/Home/home'


const AllRoutes= ()=>{
    return(
        <Routes>
            <Route exact path ='/map' element={<Leaf/>}/>
        </Routes>
    )   
}
export default AllRoutes
